import React from "react";
import ListUsers from "./ListUsers";

class CreaterList extends React.Component {

  data = this.load()

  async load() {
    // const data = [
    //   'Racing car sprays burning fuel into crowd.',
    //   'Japanese princess to wed commoner.',
    //   'Australian walks 100km after outback crash.',
    //   'Man charged over missing wedding girl.',
    //   'Los Angeles battles huge wildfires.',
    // ];
    const a = [];
    const itemSpace = await this.fetchSpace();
    const itemUser = await this.fetchUser();
    for (let item of itemSpace) {
      if (item.status === 1) {
        a.push(this.statusOne(item.id, itemUser))
      } else if (item.status === 0) {
        a.push(this.statusZero(item.id))
      } else { console.log("Ошибка") }
    }

    return a;
  }

  async fetchUser() {
    const response = await fetch('/api/users');
    const { users } = await response.json();
    return users;
  }

  async fetchSpace() {
    const response = await fetch('/api/spaces');
    const { data } = await response.json();
    return data;
  }

  statusOne = (id, users) => {
    for (let user of users) {
      if (id === Number(user.parkingLot)) {
        return `${id} - ${user.secondName} ${user.firstName} - ${user.carNumber}`
      }
    }
  }
  statusZero = (id) => {
    return `${id} - Свободно`
  }

  render() {
    return (
      <ListUsers data={data} />
    )
  }

}

export default CreaterList;
